You can make Bootstrap tables sortable alphanumerically by clicking the headers without using jQuery or other plugins by leveraging plain JavaScript. Here's a step-by-step guide to achieve this:

1. **HTML Structure**: Create a basic Bootstrap table.

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Sortable Table</title>
    <link href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css" rel="stylesheet">
</head>
<body>
    <div class="container mt-5">
        <table class="table table-bordered" id="sortableTable">
            <thead>
                <tr>
                    <th onclick="sortTable(0)">Name</th>
                    <th onclick="sortTable(1)">Age</th>
                    <th onclick="sortTable(2)">Country</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>John Doe</td>
                    <td>25</td>
                    <td>USA</td>
                </tr>
                <tr>
                    <td>Jane Smith</td>
                    <td>30</td>
                    <td>Canada</td>
                </tr>
                <tr>
                    <td>Alice Johnson</td>
                    <td>22</td>
                    <td>UK</td>
                </tr>
            </tbody>
        </table>
    </div>

    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/js/bootstrap.min.js"></script>
    <script>
        function sortTable(columnIndex) {
            const table = document.getElementById('sortableTable');
            const rows = Array.from(table.rows).slice(1);
            const isNumber = rows.every(row => !isNaN(row.cells[columnIndex].innerHTML));
            const sortedRows = rows.sort((a, b) => {
                const aValue = a.cells[columnIndex].innerHTML;
                const bValue = b.cells[columnIndex].innerHTML;
                if (isNumber) {
                    return aValue - bValue;
                } else {
                    return aValue.localeCompare(bValue);
                }
            });

            // Clear the table body
            while (table.rows.length > 1) {
                table.deleteRow(1);
            }

            // Append sorted rows
            sortedRows.forEach(row => table.tBodies[0].appendChild(row));
        }
    </script>
</body>
</html>
```

2. **JavaScript Function**: The `sortTable` function is defined to handle the sorting logic.

- **Parameters**: The function takes `columnIndex` as a parameter, which indicates the column to sort by.
- **Table and Rows**: It retrieves the table and converts the rows (excluding the header) into an array.
- **Sorting Logic**: It checks if the column contains numeric values and sorts accordingly. For alphanumeric sorting, it uses `localeCompare`.
- **Clearing and Appending**: It clears the existing rows and appends the sorted rows back to the table.

3. **Event Handling**: The `onclick` event is added to the table headers to call the `sortTable` function with the appropriate column index.

This approach ensures that the table can be sorted alphanumerically by clicking the headers without relying on jQuery or other plugins.

