```
FIREBASE_API_KEY=your_api_key_here
```

4. **Create a function to generate a custom token:**

To authenticate guest users, you'll need to generate a custom token using the Firebase Admin SDK. First, install the Firebase Admin SDK via composer:

```bash
composer require kreait/laravel-firebase
```

Then, add the following code to a controller or a service class to generate a custom token:

```php
use Kreait\Firebase\Factory;
use Kreait\Firebase\ServiceAccount;

public function generateCustomToken()
{
    $serviceAccount = ServiceAccount::fromJsonFile(base_path('path/to/your/serviceAccountKey.json'));
    $firebase = (new Factory)
        ->withServiceAccount($serviceAccount)
        ->create();

    $auth = $firebase->getAuth();
    $customToken = $auth->createCustomToken('guest_user_id'); // You can generate a unique ID for guest users

    return $customToken->toString();
}
```

5. **Create a function to sign in the guest user:**

Now, create a function to sign in the guest user using the custom token:

```php
use Illuminate\Support\Facades\Http;

public function signInGuestUser($customToken)
{
    $apiKey = config('services.firebase.api_key');
    $response = Http::post("https://identitytoolkit.googleapis.com/v1/accounts:signInWithCustomToken?key={$apiKey}", [
        'token' => $customToken,
        'returnSecureToken' => true,
    ]);

    return $response->json();
}
```

6. **Usage:**

Finally, you can use these functions to authenticate guest users:

```php
$customToken = $this->generateCustomToken();
$guestUser = $this->signInGuestUser($customToken);

// Now you have the guest user's credentials (idToken, refreshToken, etc.)
```

